    // 这个方法本身并没有什么问题，但是在取余的过程中跟结果不一致，这我不管了
    private final static int THRESHOLD = 1000000007;

    public int countPairs(int[] deliciousness) {
        long result = 0;
        int len = deliciousness.length;
        if (len < 2) {
            return 0;
        }
        Set<Integer> set = new HashSet<>() {{
            add(1); add(2); add(4); add(8); add(16); add(32); add(64); add(128); add(256); add(512); add(1024); add(2048);
            add(4096); add(8192); add(16384); add(32768); add(65536); add(131072); add(262144); add(524288); add(1048576);
            add(2097152);
        }};
        int max = -1, min = Integer.MAX_VALUE;
        Map<Integer, Integer> m = new HashMap<>();
        for (int i = 0; i < len; ++i) {
            max = max < deliciousness[i] ? deliciousness[i] : max;
            min = min > deliciousness[i] ? deliciousness[i] : min;
            m.put(deliciousness[i], m.getOrDefault(deliciousness[i], 0) + 1);
        }
        final int MAX_THR = max * 2;
        final int MIN_THR = min * 2;
        set.removeIf(s -> s > MAX_THR || s < MIN_THR);
        for (int n: m.keySet()) {
            for (int s: set) {
                int tmp = s - n;
                if (m.containsKey(tmp)) {
                    if (n == tmp) {
                        int k = m.get(n);
                        if (k < 2) {
                            continue;
                        }
                        result += k * (k - 1);
                    } else {
                        result += m.get(n) * m.get(tmp);
                    }
                }
            }
        }
        return (int)((result/2) % THRESHOLD);
    }

